import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';

export default class GridContainer extends React.Component {
    render() {
        return(
            <Container>
                <Row >
                    <Col xs={4} md={3}>1 of 2</Col>
                    <Col xs={4} md={3}>2 or 2</Col>
                </Row>
            </Container>
        )
    }
}
